import React from "react";

const NotFound = () => {
  return (
    <div style={{ margin: "0 auto" }}>
      <div className="fs-1 bold">Not Found :(</div>
      <br />
      <img
        src={require("../images/crumbs.png")}
        alt="A picture of a plate with only crumbs."
        style={{ width: "50vw" }}
      />
    </div>
  );
};

export default NotFound;
